import Task from "./Task";
import { FaArrowUp } from "react-icons/fa";
const ShortTasks = ({ tasks, onDelete, onToggle }) => {
  return (
    <>
      <h3 style={{ background: "lime", display: "flex" }}>
        Fadsfsd <FaArrowUp style={{ alignItems: "right" }} />
      </h3>
      {tasks.map(
        (task) =>
          task.type === "short" && (
            <Task
              key={task.id}
              task={task}
              onDelete={onDelete}
              onToggle={onToggle}
            ></Task>
          )
      )}
    </>
  );
};

export default ShortTasks;
